<b><i>&emsp;<u>Arataki Itto</u> : </i> </b>
<br>
&emsp;"ทายาทแห่งเผ่าโอนิ ชายหนุ่มผู้มีนิสัยเลือดร้อนเอาไงเอากัน ดุดันดั่งสายลม และสะดุดตาดุจสายฟ้า"
<br>
&emsp;เด็กหนุ่มผู้มีสายเลือดแห่งเผ่าโอนิไหลเวียนอยู่ในกาย ดุดันดั่งสายลม และสะดุดตาดุจสายฟ้า <br>
&emsp;เอกลักษณ์ประจำกายของเขา ย่อมเป็นเขาโอนิและเสียงดังโหวกเหวกของเจ้าตัว<br>
&emsp;วิถีทางของเขานั้นอิสรเสรีเกินกว่าจะจินตนาการได้<br>
&emsp;หลักเกณฑ์ของเขาคือการพุ่งทะยานและความเลือดร้อนแบบลูกผู้ชาย<br>
&emsp;ความสุขของเขาเกิดจากทุกช่วงทุกเวลา! คุณเคยได้ยินชื่อแก๊ง Arataki มาก่อนหรือเปล่า?<br>
&emsp;ไม่รู้จัก? งั้นก็มาเริ่มรู้จักแก๊ง Arataki ที่โลดแล่นอยู่ใน Hanamizaka ตั้งแต่วันนี้เลย รวมถึงบุคคลที่สะดุดตาที่สุดในนั้นอย่าง Arataki Itto ด้วยเลยแล้วกัน!<br>
